            <h3><strong>¿Quienes Somos?</strong></h3><br>
                <p style="font-size: 20px;">La empresa fue creada con el fin de brindar el servicio de delivery de medicamentos e insumos relacionados a la salud. Para esto tendremos como principal herramienta una aplicación web llamada PharmaCour que permitirá al usuario ver, elegir y comprar el producto médico que desee. Debido a la situación que atraviesa el país decidimos darle prioridad al sector salud y así ofrecer a la población una alternativa a la hora de adquirir productos médicos. El servicio que se ofrecerá abarcará ciertos distritos de la ciudad de Huancayo, y trabajaremos con las principales farmacias que operan en la ciudad. Por último, la empresa tendrá como principal slogan “Siempre cerca para cuidar tu salud”, por lo que la calidad, rapidez, seguridad y sanidad serán los principales pilares con los que realizaremos el servicio.</p>
                
